import React from "react";
import InputIcon from "@material-ui/icons/Input";
import LanguageIcon from "@material-ui/icons/Language";

const DataPack = ({
  name,
  description,
  value,
  onClick,
  id,
  isPurchased,
  dataLink,
}) => {
  return (
    <React.Fragment>
      <div class="dataPack box-shadow">
        <LanguageIcon />
        <h5>{name}</h5>
        <p>{description}</p>
        {!isPurchased && (
          <button
            type="button"
            onClick={onClick}
            class="btn dataPackButton"
            value={value}
            name={name}
            id={id}
          >
            ${value} <span />
            <InputIcon />
          </button>
        )}
        {isPurchased && <p>Purchased</p>}
      </div>
    </React.Fragment>
  );
};

export default DataPack;
